import React from 'react';
import ParticipantForm from './components/ParticipantForm';

function App() {
  return (
    <div style={{ padding: '2rem', fontFamily: 'Arial' }}>
      <h1>Создание участника</h1>
      <ParticipantForm />
    </div>
  );
}

export default App;
